import java.util.*;
public class Code {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner sc= new Scanner(System.in);
		int N= sc.nextInt();
		for(int i=10; i>0; i--){
            System.out.print(N*i+" ");
        }
        System.out.println();
	}

}
